import SearchBar from "./SearchBar";
import { NavLink } from "react-router-dom";

const Nav = ({onSearch}) => {
  return ( 
    <div>
      <SearchBar
    onSearch={onSearch}
    />
    <NavLink>
      <button></button>
    </NavLink>
    <NavLink>
      <button></button>
    </NavLink>
    </div>
    
   );
}
 
export default Nav;
